/* USER CODE BEGIN 4 */
void EXTI0_IRQHandler(void){

	HAL_GPIO_EXTI_IRQHandler(Button0_Pin); // Clear interrupt flags

	// TODO: Debounce using HAL_GetTick()
      if(ReadButton(GPIOA, GPIO_PIN_0)){
    	  // TODO: Disable DMA transfer and abort IT, then start DMA in IT mode with new LUT and re-enable transfer
    	  // HINT: Consider using C's "switch" function to handle LUT changes
    	  if(current == 5){
    		  current = 0;
    	  }
    	  else{
    	      current++;
    	  }
    	  // change the timer 2 period to speedup/slow down how fast the sound plays accordingly
    	  TIM2_Ticks = (TIM2CLK/(NS*FSignal_vals[current]));
    	  htim2.Init.Period = TIM2_Ticks-1;           // Set new period
    	  HAL_TIM_Base_Init(&htim2);

    	  //stop DMA to change the LUT used
    	  __HAL_TIM_DISABLE_DMA(&htim2, TIM_DMA_CC1);
    	  HAL_DMA_Abort_IT(&hdma_tim2_ch1);

    	  //change LUT and restart DMA
    	  HAL_DMA_Start_IT(&hdma_tim2_ch1,
    	                  (uint32_t)LUTS[current],          // Source address (LUT in memory)
						  DestAddress,  // Destination (PWM duty cycle register)
    	                  NS);                         // Number of LUT samples
    	  __HAL_TIM_ENABLE_DMA(&htim2, TIM_DMA_CC1);

    	  //update the LCD
    	  lcd_command(CLEAR);
    	  lcd_putstring(LUT_names[current]);


      }


}

//debounce function

#define DEBOUNCE_TIME 20  // ms

uint8_t ReadButton(GPIO_TypeDef* GPIOx, uint16_t GPIO_Pin)
{
    static uint32_t lastPressTime = 0;

    if (HAL_GPIO_ReadPin(GPIOx, GPIO_Pin) == GPIO_PIN_SET)
    {
        if (HAL_GetTick() - lastPressTime > DEBOUNCE_TIME)
        {
            lastPressTime = HAL_GetTick();
            return 1;  // valid press
        }
    }
    return 0;
}


